Ext.data.JsonP['PyDev_Quick_Outline']({"guide":"<?xml version=\"1.0\" encoding=\"UTF-8\" ?>\n<!DOCTYPE html PUBLIC \"-//W3C//DTD XHTML 1.0 Transitional//EN\"\n        \"http://www.w3.org/TR/xhtml1/DTD/xhtml1-transitional.dtd\">\n<html xmlns=\"http://www.w3.org/1999/xhtml\">\n<head>\n    <title>PyDev Quick Outline</title>\n\n    <meta http-equiv=\"Content-Type\" content=\"text/html; charset=UTF-8\">\n    <meta content=\"Scroll EclipseHelp Exporter\" name=\"generator\">\n\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\">\n    <link type=\"text/css\" rel=\"stylesheet\" media=\"print\">\n</link></link></link></meta></meta></head>\n<body>\n    <div class=\"container\">\n\t\t<div id=\"banner\" class=\"confbox admonition admonition-note aui-message warning shadowed information-macro\">\n\t\t\t<p>You can now find Appcelerator documentation at <a href=\"https://docs.axway.com/\" target=\"_blank\">https://docs.axway.com/</a>. This site will be taken down in the near future.</p>\n\t\t</div>\n        <div class=\"header\"/>\n\n        <div id=\"src-30083067\" class=\"content\">\n                        <h1>PyDev Quick Outline</h1>\n    <p>The quick outline allows you to quickly see the outline of your current file without having to change focus to another view, and allows you to quickly filter the name you want (and when the dialog is done, you will be brought to the selection you did).    </p>\n    <p><strong class=\" \">KEYBINDING:</strong> Ctrl+O    </p>\n    <p>Doing Ctrl+O a 2nd time will show the methods/attributes from parents in the hierarchy (as shown in the image below).    </p>\n    <p>    <img src=\"images/pydev.org/images/quick_outline.png\" alt=\"images/pydev.org/images/quick_outline.png\" class=\"confluence-embedded-image confluence-external-resource confluence-content-image-border\">\n    <br>The black background is a result of using it inside Aptana Studio 3 with &apos;invasive themes&apos; turned on in the Aptana theming options.    </br></img></p>\n        </div><a id=\"editButton\" href=\"https://wiki.appcelerator.org/pages/editpage.action?pageId=30083067\"><span>Edit</span></a>\n    \n        \n    </div>\n</body>\n</html>\n","title":"PyDev Quick Outline"});